import Footer from "../footer";
import Navbar from "../Navbar";
import Brokerage from "./Brokerage";
import Hero from "./Hero";

function PricingPage() {
    return (
        <>  
            <div className="price">
           
            <hr />
             
             <p>Pricing section </p>
         


            <Hero />
            <Brokerage />
            <hr />
         


            </div>
            
        </>
    );
}

export default PricingPage;
